--
-- Name: calculate_goal_progress(uuid); Type: FUNCTION; Schema: public; Owner: vivekanandaramu
--

CREATE FUNCTION public.calculate_goal_progress(goal_instance_uuid uuid) RETURNS integer
    LANGUAGE plpgsql
    AS $$
      DECLARE
        total_progress INTEGER := 0;
      BEGIN
        -- Calculate average progress across all habits in this goal
        SELECT 
          COALESCE(AVG(
            CASE 
              WHEN hi.target_value > 0 THEN 
                LEAST(100, (hi.current_value::DECIMAL / hi.target_value::DECIMAL) * 100)
              ELSE 0 
            END
          ), 0)::INTEGER
        INTO total_progress
        FROM habit_instances hi
        WHERE hi.goal_instance_id = goal_instance_uuid;
        
        RETURN total_progress;
      END;
      $$;


ALTER FUNCTION public.calculate_goal_progress(goal_instance_uuid uuid) OWNER TO vivekanandaramu;

--
-- Name: calculate_life_metric_progress(character varying, character varying); Type: FUNCTION; Schema: public; Owner: vivekanandaramu
--

CREATE FUNCTION public.calculate_life_metric_progress(metric_name character varying, user_id_param character varying) RETURNS integer
    LANGUAGE plpgsql
    AS $$
      DECLARE
        total_progress INTEGER := 0;
      BEGIN
        -- Calculate average progress across all goals in this life metric
        SELECT 
          COALESCE(AVG(calculate_goal_progress(gi.id)), 0)::INTEGER
        INTO total_progress
        FROM goal_instances gi
        JOIN goal_definitions gd ON gi.goal_definition_id = gd.id
        WHERE gd.category = metric_name 
          AND gi.user_id = user_id_param
          AND gi.status = 'active';
        
        RETURN total_progress;
      END;
      $$;


