a135f400-870f-455a-8516-6d8175ebd8ab	903d9c1f-6cae-42b9-8344-94fe5dd9dc94	Journal Entry - 8/18/2025	Today Kavya was jumping up and down on the living room couch per usual, and I opened the window cause there was a fly that was buzzing around the house and I wanted it to have the access to the outside. Kavya looked out of the window and said “outside outside”, indicating that she could hear and smell the noises of the “outside”. Then she started singing a song that I didn’t recognize. She often sings. And I thought to myself, how innocent and wonderful her world is, worry free. And that I wish I could protect her from ever worrying. I constantly worry. As soon as I have a moment to myself, I’m just worrying. And the more kids we’ve had, it’s like adding one more responsibility to worry about. I guess it’s not scalable to take full ownership of the future of Kavya and Mira. No one can predict the future and the challenges that lies ahead for them. Only thing I can do is make them strong capable independent women who make sound choices and can bounce back from setbacks. And forge a relationship between them so do that they always have each other. As much as I’d want to give the world to them, I don’t think Vivek and I have it in us to ensure that they’re innocence as it is right now will be protected forever. That no harm will come to them. That they can sing worry free. I want them to never face any hardship, never lose confidence in themselves, never doubt their own abilities, never feel ashamed for anything they do or for anything that they are. I want them to be happy, just as they are, and find the right friends and community that help them grow and that make them happy. That don’t lead them astray. \n\nI watched this movie yesterday called “a beautiful boy”, starring Steve Carell; and it was so jarring, cause it was about how his college age son gets addicted to meth. And how difficult it was for him to help his son come around. It reminded me of this show we watched in Jamaica with Richard called “adolescence “ and it was about how boys were being led astray by influencers like Andrew tate who were wiring their brains to hate women, and one kid ends up shooting his female classmate. Then there’s also all the unimaginable stuff that happens to girls/ women in india. I feel good about not raising my girls there. If I was in india with 2 daughters, the level to which I’d worry would crush me. \n\nAs a parent, worrying seems to go hand in hand with the joys of watching these girls grow and to watching them do/say funny things. Like Mira chirps like an angry bird if she’s left alone in the bassinet for more than 5 mins. And Kavya is in a phase of just pointing to everything and saying “Kavya, this is Kavya”. How I wish I could give both of them the whole world, and protect their laughter and innocence. \n\nWatching them makes me happy and sad at the same time.\n\nAnywho, Kavya went on her first fancy dinner with her dad today. They went to a steakhouse and she was his vegetarian date. He looked at the menu and has decided she’ll have the mac and cheese. We were both excited for her, and picked out a nice dress - I picked it, he put it on her, we both did her hair - he did the top and I did the back; and put on a new pair of shoes and off they went. They looked super cute together. Vivek seems excited about this steak dinner! I’m happy for him.	2025-08-18 13:28:22.569	neutral	{}	t	2025-08-18 09:28:22.570794	2025-08-18 13:28:22.569
