312d34c8-2bb6-40e0-90be-f1102e42239b	903d9c1f-6cae-42b9-8344-94fe5dd9dc94	Navigating Parenthood and Relationship Struggles	\nAnother Friday has come around, and another summer weekend to look forward to. Our Friday mood is always better than Monday to Thursday. Weekends feel pretty good too. Maybe cause it’s still summer, and it’s not that difficult to entertain Kavya in the summer weekends.\n\nVivek and I had a tough Thursday. We were all sick. Mild cough, fever and cold. \n\nSomething in both of us snapped and we broke down to each other. It started off as an argument, an outcome of a bubbling tension undercurrent for the past few days. It was so silly (like most of our fights). He said “I’m already depressed, it’s getting cold out, summer is ending. It’s so short “, and I said “It’s 3 months, June to august”, he said “June was not summer this year”, and I said “yes it was”, to which he snapped “okay, meghna”. And I’d reached the end of my nerve of the snapping and sarcasm from the week (I’d said earlier “did you feed Loki last night”, he said “How many times does she need to be fed at night”, and I said “once”, so he said “yes, so I fed her once “), so I retaliated, and like most of our arguments, it never ends as a constructive conversation, and always always leads to a big fight. \n\nHe went on to blame me for attacking him, not loving him, or liking him, how he’s always been a good friend to me, how difficult it’s been for him to wake up every day with the pressure of finding a job, how difficult it has been for him to build a new skill ofAI. How he doesn’t think I respect him. \n\nIt’s very difficult for me to see him like this. It hurt me to hear how challenging this time is for him. I explained to him that if I didn’t like him or love him, why would I have had 2 girls with him, why would I be building a family with him. I realized in  that moment and also told him, that yes - I am doing more than him (laundry, dishes, feeding changing and putting Mira to sleep, cooking, ordering groceries, putting it away, giving Kavya a bath, dressing her in the morning, etc), but I know we’re both working equally hard, cause even though he’s doing fewer things, the things he’s doing are difficult, like looking for a job, acquiring a new skill set, feeding Kavya, driving and pickup her up from daycare every day.\n\nI realized and told him, that as magnificent as it is that we have 2 beautiful girls, we must also acknowledge that it’s too fucking hard. We’ve sacrificed time with each other. We don’t talk! We’re just passing by each other. We have no time to talk to each other. What bigger sacrifice is there? And because we’ve not been able to talk, we’ve had a communication breakdown, we’re not seeing the level of stress the other person is carrying. I can’t catch a break. My sleep is broken every night, I can’t even go to the toilet in the morning without Mira. I typically take her with me. Many times breastfeeding her while on the toilet. And with Vivek, I didn’t realize how much stress he was taking from the demands of networking and interviewing. The emotional rollercoaster of moving on to the next round and rejections. \n\nHe said he was feeling lonely. Not sleeping together, being in the basement. He said he didn’t like being there. I told him, I didn’t banish you to the basement. I wanted to protect your sleep. You can sleep in our room if you want, but I was only looking out for you. He said, that just puts more pressure on me to find a job, because you’re trying to carry all the burden yourself, taking on Mira full time and that we’re sleeping apart so he can have full energy to find a job. I said, that’s not the only reason. The other reason is Kavya. She’s high energy and you need to be well rested to match her energy. I also realized why he was depressed that summer was ending. Because I was slightly irritated at his negativity, but i realized that that was the one good thing he had going in his life right now. He enjoyed sitting out in the backyard and working. Now he wouldn’t even have that. He said all his safety nets were dispersing and the job search was becoming more intense. First the severance, then the both of Mira, and now summer, and last will be the release of his Life coach app - intention. After that he’ll have nothing else to do, but recruit. The fact that it’s been 6 months, is also weighing on him, and the longer it takes, the pressure increases.\n\nI told him, I’m not your enemy, our situation is.   We’ve both been putting on a brave face, but the reality is that we’re both under a lot of pressure. 3 major life challenges thrown at us at the same time. \nA newborn.\nLooking for a job. \nThe terrible 2s\n\nWe’ve been acting as if this is going well, but in reality, we’re working really really hard, with little to no help, and trying to have a great outcome. \n\nI also spoke to my therapist, and I told her, that i need to acknowledge we were having a tough time. Although I don’t know what to do with that acknowledgment. I told her that I don’t believe in regrets, and if I acknowledge that this phase in our life isn’t what i was expecting then it allows for regrets like “well; why did you have a second baby, knowing that you have no support system”, “well why did you quit your investment banking job which would’ve paid you well, that you wouldn’t have to worry about Vivek bringing in an income”, “well, why didnt you buy a house in 2020 or earlier so you wouldn’t have this massive mortgage”, “well why didn’t you invest your money and grow it 10 years ago”. So on. She said - what you can do with the feeling is to practice self compassion. She asked me, did you want to have kids? I thought about what she said, and I said: I think there’s a parallel universe in which I don’t have any kids. My friends thought I wouldn’t have a single kid, and after I had Kavya, they said, ok she’s one and done, and then I had the second. I told her, if I was having difficulty conceiving, I didn’t see myself wanting kids so bad that I’d want ivf.\n\nI said having kids has come at the cost of big sacrifices. I’ve lost time with Vivek. It’s also come at the cost of time that I could spend on advancing my career or getting in good shape. It’s a crushing responsibility. I’m not sure if it matches my personality, being a mother. But, I’ve heard and believe that having kids is life’s biggest adventure, and that resonates with my persona because I love adventures.\n\nI was exhausted from the day. No sleep, the crying with Vivek, the fever. But he went for a run, came back and hugged me.\n\nI just want him to get a good job quickly. This uncertainty is killing us. We’re unable to plan fun things like travel or house renovations because we want to control our cash flow in this time. I really wish he’d get to take a parental leave Feb-May, because he’s missed out on so much of Mira already.\n\nAs magnificent as these girls are, I have to admit, we’re having a difficult time fully enjoying them. It’s not all cuteness all day. The crying makes my skin crawl, the constantly being needed. \n\nBut then, at the end day, when I was pointing the thermometer at viveks head, Kavya, looking so cute in her orange onesie, said “okay, Kavya turn”. And that made me smile. \n	2025-08-23 12:45:00.507	neutral	{"family struggles","summer blues","communication breakdown","parenting challenges","emotional support"}	t	2025-08-23 08:45:00.510468	2025-08-23 12:45:00.508
19fa97d4-b2a8-4abc-a342-83f361b2729d	2703277e-97db-4096-bd30-6798dd0470d9	Family Outing Challenges and Lessons Learned	Today morning was quite busy in the household, we were trying to get to a farmers market. We did quite well under pressure. Meghna and I are trying to work together, we will become a stronger family if we continue on this path. Farmers market was fun, and there was a playground for Kavya as well. Family weekends are always kinda daunting and today was no different. All of us getting out together is a feat, and there are moments of anxieties. \n\nLike kavya potty training has been for us the last few weekends. And today, we wanted to make sure she would not have an accident. Meghna was more persistent than me about the portable potty, and Kavya did it eventually. I am learning from Meghna that persistence pays off - she has a better threshold than me.\n\nOn the way back, i kind of wanted to get back home early so that i am ready for the workout later today and kavya can nap. Closer to home, there was a guy who tore into the street from an apartment building and kind of startled me because it seemed like he was coming into my lane. I honked! Then, he kept trying to enter my lane to cut me off at the light. So i went around another car ahead of me and it was not the best judgement on my part. It was all ok, but this guy really got to me. In hindsight, maybe i should err towards cautious than let these things get to me. Although the guy was a total a-hole.	2025-08-24 18:25:13.467	neutral	{"family time","farmers market","potty training",persistence,"road rage"}	t	2025-08-24 14:25:13.634641	2025-08-24 18:25:13.47
37eb851e-a6ea-4942-97d7-2a0b9a76345a	903d9c1f-6cae-42b9-8344-94fe5dd9dc94	Navigating Summer Chaos and Family Life	Summer end is near, so we’re trying to soak it up as much as possible. Lots of time outside, sometimes we forget the sunscreen in a rush. Also it’s so hard to get sunscreen on kavya. It’s another one of those things that we’ve had to use screen time as a crutch. Brushing her teeth, getting her to put on lotion and sunscreen, cutting her nails, and now doing her hair. It used to be reading books to get her distracted, and used to be home videos, but now it’s cocomelon or apt apt. We even had to show her baby shark to get her to use the travel potty in the back of the car. The only solace is that the  outcome was good. She did make her first pee in the travel potty today before we hit up the farmers market. We were so relieved. But we were there for so long that she did end up having an accident.\n\nIt was chaos getting out of the house though. It’s sooo stressful trying to make it on time to things. We woke up at 7:30 and it was thing after thing. That’s become our life now. Feed Mira, change her, put her down, dress Kavya, for me to take a shower, make coffee, unload the dishwasher,  wash a sink full of dishes, make breakfast, feed Kavya, make Kavya use the potty, eat ourselves, drink coffee, west Mira in the wrap carrier,  pack a bag, get everyone in the car. We just kept juggling all of it, between each other. We were finally out of the door at 10:30. \n\nBut it was all worth it cause we had a good time at the leslieville super market. And didn’t rush out of there. Today kru asked me if I was going to start working out. I’m cleared to start, since it’s been 6 weeks, but I told him “I want to, I just don’t know how I’ll handle it all”. He said fair enough, Vivek can take care of the girls, and you guys can stretch out on your own. Vivek said, we can do 30 mins each. It seems possible, so I’ll give it a shot next week and see how it goes.\n\nEvo told me today that he thought i was doing a good job handling it all. I told him, thanks. My ambition is to do a good job at this, and have a fledgling career and be in great shape. I don’t know how I’ll be able to accomplish that.\n\nVivek appears to be very proud of his AI life coach app. I am too! It’s clearly very valuable. But you only get as much value out of it, as much as you put into it. I think from on overall perspective, even if it’s not a real company that he starts, what’s important is that it gives him confidence. Which is such a necessity when you’re job hunting. The time suck that it is to build this, and others, it’s worth it so long as it gives his confidence a boost, and it’s okay that the time is not used in direct job search. I’ll have to get ahead of the game too and start to level on ai as well as get back into proactive networking in my community.\n\nKavya finished her first little kickers season. I’m excited for her to try something different in the fall. Maybe dance, gymnastics and swim lessons.\n\nVivek said he’s missing out on holding Mira. I felt bad about that. It’s so challenging for him to take on a toddler full time, and he’s doing it so gracefully. This age is sooo tough. In hindsight, I wish I’d enjoyed her age from 1-2. It seems so much easier than the 2s are. But she’s also speaking so much that this age has its own charm. I’m glad she’s mostly out of diapers too.	2025-08-25 00:44:15.718	neutral	{parenting,"summer fun","toddler chaos","family time",self-care}	t	2025-08-24 20:44:15.722841	2025-08-25 00:44:15.719
c241a322-4a21-4149-8404-0c8d91f49395	2703277e-97db-4096-bd30-6798dd0470d9	Weekly Game Plan for App Launch and Networking	Going into the week tomorrow, i want to create a high level game plan. I need to finish the remaining build work for the app and get to launch by tuesday or wednesday. I also need to progress some of the new applications and continue my interview networking. If I hear back about next steps, i will have to shift gears. So, i should work fast on monday and tuesday to accomplish both my app launch and the applications. That's about it for now.	2025-08-25 02:25:54.282	neutral	{"game plan","app launch",networking,"build work","interview prep"}	t	2025-08-24 22:25:54.284613	2025-08-25 02:25:54.283
b8dd6c4c-a3b9-496c-bd7c-73cf2ca71e43	2703277e-97db-4096-bd30-6798dd0470d9	Finding Clarity Through Energy Design	Today brought some clarity I didn’t quite expect — and I’m grateful for it.\n\nI’ve been feeling a lack of motivation, especially around tasks like recruiting and connecting. It’s not that I don’t care — it’s that there’s no immediate reward, no feedback loop. In contrast, building gives me clarity and energy. I can play, I can see progress. Recruiting often feels like emotional friction — mostly no’s until there’s a yes — and that makes it heavier to face.\n\nI realized that although I created a solid plan for growth (learning, building, reflecting, sharing), I left out one key component: recruiting as a system. It wasn’t an intentional omission, but it says something. It reflects how I’ve been avoiding it — not because it’s unimportant, but because it feels less alive than the other parts.\n\nThe breakthrough came in seeing that this isn’t about motivation in the traditional sense. It’s about designing for energy. The tasks I avoid are often the ones I haven't made playable yet. So the solution might not be “try harder” — it might be to build scaffolding around those tasks that feel weighty.\n\nSome ideas I’m excited about now:\n\nCreating an AI persona to help me narrow my niche and explore micro-paths through curiosity (maybe even a custom GPT for this).\n\nDesigning a recruiting system, supported by AI, that makes outreach feel like a creative act, not just a numbers game.\n\nReframing writing and connecting as co-creative — not something I push out, but something I play with.\n\nRemembering that part of my original plan was to upskill in AI to meet the extra capacity challenge. That plan still holds — I just need to rebalance it with where my energy is actually coming from.\n\nI want to design my week around what fuels me — not just what "should" be done. That means honoring the pull of building, but also softly scaffolding the resistance I feel elsewhere. This isn’t a matter of discipline alone — it’s a matter of aligning systems with who I actually am.\n\nFor now, one small step: experiment with creating an AI “niche whisperer” to help me narrow focus while keeping curiosity alive.\n\nLet’s see where that takes me.	2025-08-26 03:40:08.266	grateful	{clarity,motivation,recruiting,energy,creativity}	t	2025-08-25 23:40:08.268407	2025-08-26 03:40:08.266
