id he’s continuing to work through it, but what he really likes doing is building his own product. And he knows that finding a job is first priority, so he grudgingly tears himself away from it.\n\nI also wish we can sleep in the same bed again. I’m counting down the days we can move Mira into her own room, so Vivek can come back into ours. It’s T minus 7 weeks.\n\nVivek said that I had a very productive day. I washed the mattress cover and sheets, changed the bedsheets of my bed, favourited weekend activities in the fall for Kavya, ordered a baby gate for the upstairs stairs, made breakfast, made a smoothie, rolled out parathas, walked Loki, wrote cards for your daycare teachers, went to the atm to get cash for the cards, created an eq bank account for Vivek. And the usual, fed changed and put Mira down for her nap. \n\nI love getting more stuff done, which are housekeeping items for us. But on most days all I’m able to do is take care of Mira and cook and clean. \n\nI’ve cracked the code (for now) on how to get Kavya to enjoy her bath. I got her a new bath toy and got colored bath bombs. It’s so amazing to see her run to take a bath now, and not have to fight to get her into the house after coming back from daycare.\n\nI’ve also somehow managed to hold on to both Mira and Kavya for atleast 20 mins (bath plus post bath). Kavya flips through her photo album, while I wipe down Mira and massage and change her, while Vivek gets Kavyas dinner ready. I bet he finds that 20 mins of baby free time, relaxing. \n\nWe also switched who walks Loki when. Before we tried letting Vivek walk her after he came back from daycare pick up, but it was becoming impossible for me to hold on to both the girls while he did that, and walking her after putting the girls down, would be a lot for him. So we traded shifts. He runs with her now in the morning and I walk her when he’s picking up Kavya. This has worked out really well! This way, even Lokis walk is not rushed.\n\nI hope Vivek gets 